import tasks from './tasks1.json';
class ViewPanel extends Component {
  constructor(props) {
    super();
  }
  render() {
    let contenta="";
    contenta = tasks[this.props.curTask].instructions;
    return <div className="viewpanel">
            <p>{contenta}</p>
        </div>
  }
}
export default ViewPanel;
